webpackJsonp([0xa0164ff05976],{5207:function(e,a){e.exports={data:{post:{html:"<p><b>Late</b><br />\nI slept 3 hours this afternoon. I had to pick up Christopher after all, and nearly overslept. We need to think of a late-afternoon nutrition plan for him. He comes home from day care hungry (yes, they do feed him!), but a whole banana and an entire yoghurt at 5:30pm tend to ruin his supper.</p>\n<p>\n<b>Early</b><br />\nThis morning my sore throat is gone and my eyes are less pink. I'm staying home anyway. I don't even have to worry about picking up Christopher. After 3 days of late meetings, Mama's going to take a short day today.</p>",fields:{title:"What A Difference A Day Makes",date:"16 Feb 2001",url:"https://papascott.de/2001-02-16-what-a-difference-a-day-makes/"}}},pathContext:{slug:"/2001-02-16-what-a-difference-a-day-makes/",prev:{fields:{title:"Back to Bed",date:"15 Feb 2001",slug:"/2001-02-15-back-to-bed/"}},next:{fields:{title:"Daylight In Your Eyes",date:"18 Feb 2001",slug:"/2001-02-18-daylight-in-your-eyes/"}}}}}});
